import React from 'react';

const FlipCard = (props) => {
    return (
        <div className="container">
            <div className="card-wrapper">
                <div className="front">
                    <div className="title">
                        <h1>{props.titleFront}</h1>
                    </div>
                    <div className="content">
                        {props.frontContent}
                    </div>
                </div>
                <div className="back">
                    <div className="title">
                        <h1>{props.title-back}</h1>
                    </div>
                    <div className="content">
                        {props.back-content}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default FlipCard;
